import React from 'react';
import { 
    ButtonContainer,
    Back 
} from './BottomNav.styles';

const BottomNavigation = (props) => {
    const { back, next } = props;

    return (
        <ButtonContainer>
			<Back>
				<a class="back" href={back}>&larr; Back</a>
			</Back>
		    <div class="next">
				<a class="next" href={next}>Next &rarr;</a>
			</div>
		</ButtonContainer>
    )
}

export { BottomNavigation };
